text = {
	["Default"] = { name = "-", desc = "未命名的塗裝套件" },
	["so_yellow"] = { name = "威嚇者", desc = "這把武器有著部分以生產線黃色噴漆的零件。\n\n這把碎顱武器是貨真價實的毀滅者。" },
	["so_olive"] = { name = "地下水", desc = "這把武器有著部分以軍綠色噴漆的零件。" },
