	["so_purple"] = { name = "致命紫羅蘭", desc = "這把武器有著部分以黑色和紫色純色噴漆的零件。\n\n典雅的設計配上兇殘的目的" },
	["so_night"] = { name = "惡夢之夜", desc = "這把武器有著部分以黑夜作戰顏色噴漆的零件。\n\n這是風的低語......是你脖子上的一咬" },
