	["so_stormfront"] = { name = "風暴", desc = "這把武器有著部分以暴風雨類似噴漆的零件。\n\n它會在單軌列車處等待你的到來" },
	["so_tornado"] = { name = "颶風咆哮", desc = "其部分零件以龍捲風色調塗裝。\n\n別被其簡潔的外觀蒙騙" },
	["so_whiteout"] = { name = "冰天雪地", desc = "這把武器全身都漆滿了白色。\n\n看似純淨，但未必表裡如一" },
	["so_jungle"] = { name = "深野叢林", desc = "這把武器有著部分以叢林色噴漆的零件。" },
	["so_space_marine"] = { name = "殖民者", desc = "此武器的個別零件以卡其色和灰色進行噴漆塗裝。" },
	["so_pmc"] = { name = "立約者", desc = "這把武器有著部分以黃褐色、深藍色和暗綠色噴漆的零件。\n\n蘿納薩布里對於賽巴斯汀沒派她進行關於特納的任務仍耿耿於懷" },
	["so_tangerine"] = { name = "爆破專家", desc = "這把武器有著以黑色與蜜柑橘色混合噴漆的零件。蘿納就跟她對自己的評價一樣優秀......她只是太年輕沒意識到不該到處賣弄這點。 - 菲力克斯萊利 指揮官" },
	["so_orange_accents"] = { name = "硝基", desc = "so_orange_accents" },
