	["hy_dive"] = { name = "潛水迷彩", desc = "此武器以水轉印方式，使用藍色迷彩進行塗裝。\n\n 我們的世界充滿了謀略與詭計 … 但有時偽裝迷彩就是為了奪人目光  - 軍火商布斯 " },
