	["an_gunmetal"] = { name = "氧化銅", desc = "an_gunmetal" },
	["an_navy"] = { name = "海軍電鍍", desc = "這武器以鉻合金為底色、塗上了半透明的深藍色陽極化顏料。" },
	["am_urban"] = { name = "數位金屬", desc = "這武器以金屬為底色，印上了都市數位迷彩（DDPAT）。" },
	["am_tiger"] = { name = "黃金戰虎", desc = "這武器有著配上鍍金與手工蝕刻的虎紋圖案。" },
	["am_dragon_glock"] = { name = "猛龍騰紋", desc = "這武器以金屬為底色，塗上了猛龍貼圖。\n\n在童話故事中騎士總能弒龍......但這是真實世界 - 維勒芮亞杰那 革命家" },
