	["am_lightning_awp"] = { name = "閃電雷擊", desc = "它的外表用了電鍍效果在它的金屬底漆上加上了一層閃電圖案。\n\n有時候你不需要打擊同一個地方兩次" },
	["am_ossify"] = { name = "冷酷無情", desc = "這武器以金屬為底色，印上了半透明抽象的淺綠色。" },
