	["aa_fade"] = { name = "漸層彩虹", desc = "這武器以鉻合金為底色，用噴槍噴了個會互相調和的半透明噴漆。\n\n這不只是一把武器，而是對話題材 - 伊莫珍 實習軍火商" },
