	["aq_copper"] = { name = "鍍銅", desc = "這是把鍍銅的武器。" },
	["aq_blued"] = { name = "藍鋼", desc = "這是把被完全染藍的武器。\n\n這是武器設計中的馬爾貝克 - 布斯 軍火商" },
	["aq_forced"] = { name = "髒亂", desc = "它的外表有著刻意用了檸檬和芥末汁液去滴在外表上頭所形成的氧化塗層。\n\n如果你現在認為它很雜亂，等到它在黑光燈之下的時候再說吧" },
	["aq_oiled"] = { name = "外殼硬化", desc = "這武器已利用木炭在極高溫度下，使外殼產生有著七彩色的硬化。\n\n一點點色彩傷不了人的" },
	["sp_spitfire_famas"] = { name = "噴火者", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "屠夫", desc = "這武器用有著不同反射程度的鋁和鉻色塗上了斑馬紋的圖案，並用紅番茄糖果的顏色覆蓋上去。\n\n維勒芮亞不是付錢來讓薩威問問題的......而是逼問出答案" },
	["am_zebra_dark"] = { name = "濁水戰術", desc = "這武器以鉻合金為底色，用有著不同反射程度的木炭金屬塗上了水棲條紋的圖案。\n\n水能載舟，亦能覆舟......" },
	["aa_vertigo"] = { name = "催眠曲", desc = "這武器以珍珠作為底色，用噴漆透過模板噴了個黑色圖案。\n\n你並不是想睡，而是因為流血而逐漸昏倒" },
	["cu_spring_nova"] = { name = "絢爛櫻花", desc = "其已被手工噴上櫻花紋理，並在表層漆上高光澤塗料。" },
	["sp_hazard"] = { name = "危機", desc = "sp_hazard" },
	["aq_rust"] = { name = "生鏽的", desc = "敗絮其外，金玉其中。" },
	["am_slither_p90"] = { name = "冷冽血光", desc = "It has been painted with a chrome base coat and candied in transparent red anodized effect paint.  It has then been laser-etched with a slithering snake motif." },
	["am_carbon_fiber"] = { name = "碳素纖維", desc = "這武器以石墨作為底色，印上了碳素纖維的顏色。\n\n我帶領著我的隊伍不代表這不是團隊的功勞 - Rona Sabri，Rising Star" },
	["am_scorpion_p2000"] = { name = "毒蠍", desc = "它的外表電鍍有漣漪花樣，且在握把處塗有紅蠍圖案。" },
	["hy_feathers_aug"] = { name = "雙翼", desc = "它的外表以乾轉印法印上了鷹羽圖案做為裝飾。\n\n老鷹看起來很雄偉，一直到牠開始挖出你的眼睛" },
	["sp_palm_shadow"] = { name = "熱帶風暴", desc = "sp_palm_shadow" },
