	["aq_brass"] = { name = "黃銅", desc = "其部分零件被替換成黃銅製品。\n\n愚人金" },
	["hy_blam"] = { name = "爆炸！", desc = "它的外表用了水轉印的手法在橘色底漆上頭印上了會在漫畫出現中的擬聲字體。" },
	["hy_blam_simple"] = { name = "砰", desc = "hy_blam_simple" },
