	["am_oval_hex"] = { name = "鋼籠", desc = "槍身以金屬碎箔漆繪成網格，再鋪上一層中空的黑色橢圓紋路。\n\nSay matte!" },
	["cu_pinstripe_ak47"] = { name = "翡翠細紋", desc = "這把槍的槍托以沼澤橡木製成，槍身則繪有白、綠相間的細紋。\n\n質疑伊莫珍就是在質疑我。咱們放鬆心情，喝點蘇格蘭威士忌，來談談生意吧。 - 《父親與鳳凰》卷二" },
	["sp_nightstripe"] = { name = "夜色斑紋", desc = "其以紙膠帶圖樣噴漆塗裝成夜間作戰配色。\n\n噴灑……祈禱……塗裝……刺殺。" },
	["cu_m4_asimov"] = { name = "艾西莫夫", desc = "它加上了科幻風格的裝飾塗裝。\n\n任何人都可以預測未來......有遠見的人則形塑它" },
