	["cu_famas_pulse"] = { name = "脈衝", desc = "它已被大膽地塗上片段的水樣紫紅色。\n\n驚人的武器配上驚人的配色" },
	["hy_marina_sunrise"] = { name = "碼頭", desc = "此武器用水轉印方式，以對比鮮明的黃色及藍色圖樣完成塗裝。\n\n有些人會稱你為英雄......其他人則稱你為壞人" },
