	["aq_obsidian"] = { name = "岩漿", desc = "槍身上有部分鍍銅處漆作岩漿般的外貌，並以高溫加熱氯化鈉造出一層紅色光澤。未漆處則透過將硫化鉀氧化染黑。\n\n射速疾如烈火" },
	["am_turqoise_halftone"] = { name = "雙鈷色調", desc = "其表面包覆著綠松色的金屬漆，再加以一層超出槍身的半色調圖形紋路。\n\n菲力克斯，你我都明瞭維勒芮亞即將點燃戰火。如今只有一個問題，那就是你準備好了沒？ - 布斯 軍火商" },
