	["am_chainmail"] = { name = "鎖鏈禁錮", desc = "槍身以銀漆為底印上了半透明的鎖鏈樣式。\n\n在所有\"鳳凰\"成員中，沒有比維勒芮亞的貼身護衛娜歐米更來的忠誠了" },
	["aq_handcannon"] = { name = "掌式加農砲", desc = "槍身上的黃銅部件被強酸潑上綠鏽，使造型像是古老的黃銅加農砲。\n\n準備在接下來的挑戰中迎接更多折磨吧" },
	["am_metal_inlay"] = { name = "黑暗年代", desc = "槍身塗上了金屬色使其看起來宛如嵌上中世紀金屬圖案。\n\n我可以幹掉她的情夫... 這也許能為你和維勒芮亞之間爭取點時間 - 《父愛》卷二" },
	["hy_vines"] = { name = "薔薇", desc = "這把武器已被印上了捲曲藤蔓與花朵的圖案。\n\n真愛之吻也無法自其棘刺拯救你" },
	["so_indigo"] = { name = "皇家湛藍", desc = "這武器已被塗上了靛、緋紅與灰色。\n\n菲力克斯你有時該笑一下，如果你不一直板著那張臉的話也許會更有女人緣 - 伊莫珍 實習軍火商" },
	["so_indigo_and_grey"] = { name = "湛青紫靛", desc = "這武器已被塗上了靛、藍與灰色。\n\n艾雷克斯金卡德，我知道你心裡有很多問題... 請容我一一回答你 - 《鳳凰與說書人》卷一" },
	["cu_well_traveled_ak47"] = { name = "炫富旅人", desc = "這武器的槍拖被棕色皮革包覆著。它已去過不少城市了。\n\n任何細心觀察的人都能將線索串起來然後發現她的所作所為。我們沒時間想辦法了... - 《父愛》卷一" },
	["cu_green_leather"] = { name = "頭等艙", desc = "這武器的槍拖被綠色皮革包覆著。\n\n不包含含羞草" },
	["cu_brown_leather_p90"] = { name = "皮革", desc = "這武器的槍拖被棕色皮革包覆著。\n\n別擔心，此產品通過 TSA 認證" },
	["cu_luggage_mac10"] = { name = "通勤", desc = "這武器已被印上了格子花呢的圖案，並在部分處用人造鱷魚皮革包覆著。\n\n魚餌上鉤了，我們走吧... - 艾略特金斯曼 雇傭兵" },
	["cu_medieval_dragon_awp"] = { name = "龍之傳說", desc = "這把武器有著纏結龍體的自繪圖案。\n\n200 把鑰匙也無法解開箇中奧秘" },
	["cu_luggage_p2000"] = { name = "經濟艙", desc = "這武器已被印上了格子花呢的圖案，並在部分握把處用棕色皮革包覆著。\n\n雖然看起來很樸素，但它的確十分實用" },
	["aq_pilot_deagle"] = { name = "機長", desc = "這把武器在特有的機長羽翼圖案用黃銅鑲嵌。\n\n預估墜落位置" },
	["cu_leather_xm1014"] = { name = "紅色皮革", desc = "這武器的槍拖與握把都被紅色皮革包覆著。\n\n整裝待發。去殺死那狗娘養的…- 《邪鬼與女武神》卷二" },
	["cu_luggage_sg553"] = { name = "旅行者", desc = "槍身印有像是老舊行李的條紋設計，而有些部分被褐色皮革包裹。\n\n每個人都有自己的秘密，薩威在行刑前會將它們全挖出來。" },
	["cu_luggage_usp-s"] = { name = "商務艙", desc = "這把武器使用的自定義塗裝，所用的顏色和圖案都由舊式行李箱得到啟發，部分部件使用了棕色皮革包裹。 \n\n有些人不只是想要額外的活動空間… 他們想要和平與寧靜" },
	["hy_plaid1"] = { name = "橄欖色格紋", desc = "這武器被印上了米色與橄欖綠的格子圖案。\n\n我喜歡。它能在拍照時突顯我的眼睛...... - 蘿納薩布里 \"新星\"" },
	["chy_plaid2"] = { name = "綠色格紋", desc = "chy_plaid2" },
	["cu_m4a1-s_silence"] = { name = "大師傑作", desc = "其已被客製化塗裝為狂野塗鴉風格。" },
