	["am_nuclear_skulls2_famas"] = { name = "冥河", desc = "其已被鍍鉻並覆以半透明水轉印的核子骷髏圖樣。" },
	["am_nuclear_skulls3_mac10"] = { name = "核子樂園", desc = "其已被鍍鉻並覆以半透明水轉印的核子骷髏圖樣。" },
	["hy_nuclear_skulls4_p250"] = { name = "污染", desc = "hy_nuclear_skulls4_p250" },
	["hy_nuclear_skulls5_tec9"] = { name = "毒藥", desc = "其已被塗裝成搶眼的透明水轉印的核子骷髏圖樣。" },
	["so_grey_nuclear_green_bizon"] = { name = "綠色化學", desc = "這武器已被塗上了灰與花綠色。" },
	["so_grey_nuclear_orange_five_seven"] = { name = "熱情射擊", desc = "這武器已被塗上了淺灰色與熱綠色。" },
	["cu_cerbrus_galil"] = { name = "地獄犬", desc = "其被客製化塗裝上地獄犬圖樣，地獄犬是守衛冥界的三頭犬。" },
	["cu_tribute_ak47"] = { name = "荒土之亂", desc = "其被磨損仿舊，雕版印刷，再加上塗鴉。\n\n有一天，他們會問我們為何而戰，而一旦他們問了，他們自己也會明白 - 娜歐米 維勒芮亞杰那的保鑣" },
	["aq_glock_coiled"] = { name = "粉碎者", desc = "鋼鐵側以結合模板法以及手繪的方式使用油畫顏料的方式塗裝。\n\n唯有施予壓力才能成就鑽石" },
	["am_g3sg1_murky"] = { name = "黝暗", desc = "其已經陽極處理並附以水轉印豹紋圖樣。\n\n夜路無垠" },
	["aq_m4a1s_basilisk"] = { name = "翼蜥", desc = "這武器已被蝕刻了一隻翼蜥的圖案。\n\n盯著別人是很無禮的，不過戰爭可不是噓寒問暖的時候" },
	["cu_m4a4_griffin"] = { name = "獅鷲", desc = "這武器已被手繪上了獅鷲的插畫。\n\n菲力克斯親自從世界各地挑選他的隊員...... 人們質疑他們的性格，但從不過問行動結果" },
	["sp_mag7_firebitten"] = { name = "縱火者", desc = "其被分層噴漆，再磨損以呈現灼燒的痕跡。\n\n星火燎原" },
	["cu_mp9_chevron"] = { name = "鏢彈", desc = "其以水轉印塗裝上 V 字狀條紋圖樣。\n\n射的子彈夠多，終究會打中目標" },
	["aq_p250_cartel"] = { name = "卡特爾", desc = "這武器已被刻上了骷髏、鮮花以及蛇的圖案。\n\n輕輕一擠讓每個早晨都變成死亡之日" },
	["cu_p2000_fire_elemental"] = { name = "火元素", desc = "這武器已被客製化地塗上了圖像樣式的火元素圖案。\n\n有時玩火是件好事" },
	["aq_sawedoff_blackgold"] = { name = "攔路強盜", desc = "這武器已被塗漆上了用黑與金色搭配的蘇格蘭葪花圖案。\n\n你扣下扳機時不用翹起小指，但這麼做也不錯" },
	["cu_scar20_intervention"] = { name = "強心劑", desc = "這武器已被乙烯預印熱封上了個現代橘與藍色的設計圖案。\n\n嗶，嗶，嗶嗶嗶..." },
	["sp_ump45_d-visions"] = { name = "妄想", desc = "這武器已用網版印上了鸚鵡螺的圖案。\n\n卡爾克薩在呼喚著" },
	["cu_xm1014_caritas"] = { name = "安寧", desc = "這武器已被手繪上了個長髮女人的圖案。\n\n我不是來此追尋我需要的；而是我想要的 - 《伊莫珍與邪鬼》卷二" },
	["am_awp_glory"] = { name = "戰神", desc = "其以藍色金屬漆為基底，並以金漆手繪漩渦點綴。\n\n欲擒蛇，必先引蛇出洞" },
	["cu_elites_urbanstorm"] = { name = "都市衝擊", desc = "其被客製化塗裝為都市迷彩與藍色調。\n\n雷鳴總是伴隨閃電而來" },
	["aq_deagle_naga"] = { name = "納迦", desc = "其被刻上神話圖騰。\n\n來自印度神話的野獸，在戰場上也同樣凶狠" },
	["cu_galil_abrasion"] = { name = "喋喋不休", desc = "其被手繪塗裝並磨損仿舊。畫在防塵罩上的骷髏在槍機往返時看起來就像喋喋不休的樣子。\n\n有些人說，當你笑了，世界就笑了……但這些傢伙笑起來，世界只會尖叫" },
	["cu_glock_deathtoll"] = { name = "地下墓穴", desc = "其以銀色金屬漆為基底，覆以水轉印骷髏圖樣。\n\n恫嚇是最誠摯的奉承" },
	["cu_m4a4_ancestral"] = { name = "龍王 (Dragon King)", desc = "這武器已被客製化地塗上了有著紅與藍色的中國龍圖案。\n\n一把足以配得上美猴王的武器 - 布斯 軍火商" },
	["cu_m249_sektor"] = { name = "系統鎖", desc = "加上了科幻風格的裝飾塗裝。\n\n這麼棒的火力援護哪裡找" },
	["am_mac10_malachite"] = { name = "孔雀石", desc = "其使用金屬效果漆塗裝，並用橡膠梳狀工具勾勒出波浪圖樣。\n\n光亮的色彩隱藏著一把暗懷鬼胎的槍" },
	["cu_mp9_deadly_poison"] = { name = "致命毒藥", desc = "其客製化塗裝上動感的三角形與一隻非寫實的蜘蛛。\n\n殺死你的不是被咬中的第一下，而是之後的二十九下。" },
	["cu_p250_mandala"] = { name = "亡靈", desc = "此武器以環形圖案進行客製化塗裝。\n\n這把武器沉浸在傳統和血泊之中" },
	["cu_sawedoff_deva"] = { name = "寧靜", desc = "其塗裝上了有翼女性的圖樣。\n\n僅有少數人能享有安寧 - 維勒芮亞杰那 革命家" },
	["aq_scar20_leak"] = { name = "石窟", desc = "這武器以藍色金屬塗料進行了點畫和塗色。\n\n時令集團的創辦人在被聲名遠播的特務伊崎孝太郎搭救後，委託訂製了這把武器" },
	["aq_xm1014_sigla"] = { name = "水銀", desc = "其以金屬銀色塗層做為基底，印下以地形圖為主題的水轉印圖樣。\n\n有時候你需要一些不穩定的元素來解決問題 - 伊崎孝太郎 攻堅專家" },
	["an_tiger_orange"] = { name = "虎牙", desc = "其被陽極處理成橘色，並手工蝕刻上虎紋圖樣。\n\n珍稀如虎……致命如虎……" },
	["am_marble_fade"] = { name = "大理石漸層", desc = "其以黑色與銀色金屬漆仿大理石紋塗裝，再覆上三色糖果漆。\n\n這刀上有很多顏色，但不久後只會剩下紅色" },
	["am_marbleized"] = { name = "都卜勒", desc = "其以黑色與銀色金屬漆仿大理石紋塗裝，再覆上糖果漆。\n\n迷失於其艷麗的色彩將招致死亡" },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "裝甲核心", desc = "其以黑色油性塗料塗裝並加上刷過漆的不鏽鋼配件與鑲嵌裝飾。\n\n對重視複雜性與火力的幹員來說，這就是完美的武器 - 布斯 軍火商" },
	["aq_awp_twine"] = { name = "蟲中之神", desc = "其以高耐久性瓷漆塗裝上髑髏與樹根的意象。\n\n有些樹根你想都不想碰" },
	["am_bronze_sparkle"] = { name = "青銅飾物", desc = "其使用金屬汽車塗料客製化塗裝上裝飾風藝術圖樣。\n\n所有人都追尋著白銀與黃金" },
	["aq_p250_contour"] = { name = "化學鏈價", desc = "其被輔以武器外型的藍灰設計客製化塗裝。\n\n我質疑的不是你的技術，而是你的態度 - 《導師與傳統破壞》卷一" },
	["cu_fiveseven_banana"] = { name = "猴子勾當", desc = "這是根香蕉。\n\n有的時候把玩食物是可以接受的" },
	["cu_galil_eco"] = { name = "Eco", desc = "其被塗裝為白綠配色，並以熱轉印貼花加強細節。\n\n有了足夠的資金，精銳部隊就能承擔任何目標" },
	["aq_famas_jinn"] = { name = "神燈精靈", desc = "其被鑲上金與鎳並刻上神燈精靈的形象。\n\n小心許願" },
	["cu_m4a1_hyper_beast"] = { name = "Hyper Beast", desc = "It has been custom painted with a beastly creature in psychadelic colours.\n\nYou really want to impress me Booth? Make this black light sensitive - Rona Sabri, Rising Star" },
	["cu_mag7_redhot"] = { name = "PaintKit_cu_mac10_redhot_tag", desc = "PaintKit_cu_mac10_redhot" },
	["am_negev_glory"] = { name = "PaintKit_am_awp_glory_Tag", desc = "PaintKit_am_awp_glory" },
	["cu_mac10_neonrider"] = { name = "霓虹騎士", desc = "其被客製化塗裝上死亡騎士的圖樣。\n\n一把槍。兩個活頁夾" },
	["cu_sawedoff_origami"] = { name = "紙鶴", desc = "其以摺紙設計圖樣客製化塗裝。\n\n打造美麗的事物需要時間，但轉瞬間即可摧毀" },
	["cu_cz75_precision"] = { name = "杆位", desc = "其以紅灰賽車主題客製化塗裝\n\n我們只有一次機會，好好把它搞定 - 菲力克斯萊利 指揮官" },
	["am_ump_racer"] = { name = "大賞頭獎", desc = "其以老式賽車主題客製化塗裝。\n\n別忘了戴上安全帽" },
	["am_aqua_flecks"] = { name = "暮光星海", desc = "am_aqua_flecks" },
	["cu_chronos_g3sg1"] = { name = "克羅諾斯", desc = "其以水轉印塗裝上幻彩的鐘表機構，並以熱轉印貼花點綴。\n\n時間能造就一切" },
	["hy_hades"] = { name = "黑帝斯", desc = "其塗裝上水轉印古希臘頭盔圖樣。\n\n若她想讓我接受採訪，那麼可能有更簡單的預訂方法 - 《盾與說書人》卷二" },
	["hy_icarus"] = { name = "伊卡洛斯殞落", desc = "其被以水轉印方式印上羽毛與融化的蠟環繞太陽的圖樣。\n\n特納的背叛是我的錯……我得撥亂反正 - 賽巴斯汀‧漢魁 狙擊手" },
	["cu_labyrinth"] = { name = "牛頭怪的迷宮", desc = "其印上了等距迷宮的水轉印圖樣。\n\n你逃不出我的手掌心" },
	["sp_labyrinth1"] = { name = "星點", desc = "其以等距迷宮的模板噴漆塗裝。\n\n王只是凡人…而凡人不應該被崇拜… - 維勒芮亞杰那 革命家" },
	["sp_labyrinth2"] = { name = "探路人", desc = "其以等距迷宮的模板噴漆塗裝。\n\n我個人比較喜歡第四版，但顧客至上 - 布斯 軍火商" },
	["sp_labyrinth3"] = { name = "代達羅斯", desc = "其以等距迷宮的模板噴漆塗裝。\n\n伊莫珍…如果他們知道你幹了什麼好事，這可能會使我們賠上一切 -《家族事務》卷一" },
	["cu_medusa_awp"] = { name = "梅杜莎", desc = "它已被客製化地塗上了蛇髮女妖的圖像。\n\n如果你能看見我，那你早已死亡" },
	["gs_mother_of_pearl_elite"] = { name = "決鬥家", desc = "其被加上塗裝過的珍珠母握把與暗色氧化層。\n\n不含方形泡泡糖" },
	["aa_pandora"] = { name = "潘朵拉的盒子", desc = "其被噴上了卡通鬼魂圖樣。\n\n 世界正受戰火肆虐，但至少我們胸懷希望" },
	["cu_poseidon"] = { name = "波賽頓", desc = "它已被客製化地塗上了波賽頓與雙魚戰鬥的意象。\n\n三個人能夠保守秘密，如果其中兩個已經死亡" },
	["hy_zodiac1"] = { name = "天秤載月", desc = "其被以水轉印方式印上黃道十二宮的圖樣。\n\n今天不只是求歡，也是殺死敵手的好日子" },
